import React from 'react';
import { Jumbotron, Container } from 'reactstrap';

const Card = {
  render() {
    return (
      <div>
        <Jumbotron fluid>
          <Container fluid>
            <h1 className="display-3">Main Workspace</h1>
          </Container>
        </Jumbotron>
      </div>
    );
  },
};

export default Card;
